import { APIGatewayProxyEventV2 } from 'aws-lambda';
import axios from 'axios';
import { FromSchema } from 'json-schema-to-ts';

const parameter = {
  type: 'object',
  properties: {
    image: { type: 'string' }, // Base64 encoded image (or toss=test)
  },
  required: ['image'],
} as const;

export const handler = async (event: APIGatewayProxyEventV2) => {
  console.log('[event]', event);
  const { image } = JSON.parse(event.body) as FromSchema<typeof parameter>;
  console.log('[image]', image);

  const testImageToss =
    'data:image/jpeg;base64,';

  const res = await axios.post(
    'https://f5ytt7f6e2.apigw.ntruss.com/custom/v1/27307/98fc5e10db4340ecf1f0b8d4793b12f9160441e0509a1046494ba1a5c376f55e/general', // APIGW Invoke URL
    {
      images: [
        {
          format: 'jpeg', // file format
          name: 'OCR_Result', // image name
          data: (image === 'toss' ? testImageToss : image).split(',')[1], // image base64 string(only need part of data). Example: base64String.split(',')[1]
        },
      ],
      requestId: 'wooung', // unique string
      timestamp: 0,
      version: 'V2',
    },
    { headers: { 'X-OCR-SECRET': 'WlBoanF0d3pSdXZ4VHZhdVVtd2dwa2ZBRWVNcmJiVHM=' } }
  );
  console.log('requestWithBase64 response:', res.data.images);

  return {
    statusCode: 200,
    body: JSON.stringify({ result: res.data.images[0].fields.map((field: any) => field.inferText) }),
  };
};
